// теория игр, перебор вариантов, поиск закономерности
#include <bits/stdc++.h>
#define all(x) (x).begin(),(x).end()
#define isz(x) (int)(x).size()
using namespace std;
using vi = vector<int>;
using vvi = vector<vi>;
template<typename T>
ostream &operator<<(ostream &os, const vector<T> &v) {
    os << '{';
    for (int i = 0; i < isz(v); i++) {
        if (i > 0) os << ',';
        os << v[i];
    }
    return os << '}';
}
// Решение задачи перебором всех вариантов (исследование дерева игры):
map<pair<vi, int>, bool> cache;
bool dfs(vi a, int i) {
// если i >= 0, то мы должны уменьшить i-ю кучку и выбрать для противника кучку
    assert(i >= 0);
    int sum = accumulate(all(a), 0);
    if (a[i] == sum)
        return cache[{a,i}] = true;
    if (auto it = cache.find({a,i}); it != cache.end())
        return it->second;
    // выбираем шаг:
    for (int x = 1; x <= a[i]; x++)
        // выбираем следующую кучку
        for (int j = 0; j < isz(a); j++) {
            a[i] -= x;
            if (a[j] > 0 && !dfs(a, j)) {
                a[i] += x;
                return cache[{a,i}] = true;
            }
            a[i] += x;
        }
    return cache[{a,i}] = false;
}
string solve(vi a) {
    string answ = "Alice";
    for (int i = 0; i < isz(a); i++)
        if (a[i] > 0 && !dfs(a, i)) {
            answ = "Bob";
            break;
        }
    return answ;
}
// Результат исследования: победитель зависит от количества единиц в векторе
// Если n - чётное, то побеждает Алиса, если число единиц - чётное, но меньше n
// Если n - нечётное, то побеждает Боб, если число единиц - нечётное, но меньше n
string fast(vi a) {
    if (isz(a) == 1)
        return "Alice";
    if (isz(a) == 2)
        return *min_element(all(a)) == 1 ? "Bob" : "Alice";
    // считаем количество единиц:
    int cnt1 = (int)count(all(a), 1);
    if (isz(a) % 2 == 0)
        return cnt1 % 2 == 0 && cnt1 < isz(a) ? "Alice" : "Bob";                
    else
        return cnt1 % 2 == 1 && cnt1 < isz(a) ? "Bob" : "Alice";
}
void solve() {
    int n; cin >> n;
    vi a(n);
    for (int i = 0; i < n; i++)
        cin >> a[i];
    cout << fast(a) << endl;
}
void research() {
    // брутфорс всех векторов длины <= 6 и вывод на экран
    // победителя для поиска формулы
    const int base = 6;
    for (int n = 1; n <= base; n++) {
        cout << "n = " << n << ":\n";
        const int limit = (int)pow(base, n);
        vi a(n);
        map<pair<int,string>, vvi> table;
        for (int mask = 0; mask < limit; mask++) {
            bool ok = true;
            for (int temp = mask, i = 0; i < n; temp /= base, i++) {
                a[i] = temp % base + 1;
                if (i > 0 && a[i-1] > a[i])
                    ok = false;
            }
            if (ok) {
                //for (int i = 0; i < n; i++)
                //    cout << setw(3) << a[i];
                auto slow = solve(a);
                auto ft = fast(a);
                assert(slow == ft);
                table[{count(all(a), 1), slow}].push_back(a);
                //cout << ": " << slow << endl;
            }
        }
        for (const auto &[key,val] : table) {
            const auto &[k,s] = key;
            cout << setw(4) << k << " ones: " << s << ' ' << val;
            cout << endl;
        }
    }
}
